        date="August 2018 - May 2022"
        gpa="3.85"
      />
      <p className="Education-description">At Lehigh, I was a student in the Universityâ€™s Integrated Business and Engineering (IBE) Honors Program, a highly selective and rigoruos curriculum that awards each student an AACSB-accredited business degree in their major of choice (e.g. Finance). </p>
      <div className='Education-buttons'>
        <Button href='https://ibe.lehigh.edu' target="_blank">IBE homepage</Button>
        {/* TODO: Delete button, adjust buttons wrapper if needed */}
        {/* <Button>View Coursework</Button> */}
      </div>
      <h3>Coursework</h3>
      <Tabs value={value} onChange={handleChange} centered>
        <Tab label="Item One" />
